Eating breakfast;

Having a breakfast I look forward to is one of the only reasons I get out of bed.

More importantly, your brain burns 20% of the calories you consume every day. If you’re not eating until the afternoon, how can you expect your brain to function?

Protein powders;

NEVER DRY SCOOP! There is a lot of caffeine in some of these and it needs to be diluted. If you dry scoop I will hunt you down 🔫.

ADHD brains need more protein than other brains. This is a good way to get it and some caffeine to wake up.

Tea;

Green tea wakes up my brain more than my body. It’s best for homework and reading comprehension.

I don’t love the taste so I buy Verb Energy Bars. They’re the best green tea bars for me but Cliff is also good.

Coffee;

Obviously coffee is not the same as adderall but it effectively gets me up in the morning.

I make it the night before. Then I boil it and put it in a Yeti. It stays warm so I can drink it in the morning and leave it on my nightstand.
